import Link from 'next/link';
import Image from '../../UI/Image/Image';
import Button from '../../UI/Button/Button';

const post = (props)=>(
        <div className="row">
                <h6>{props.name}</h6>
                <Image image={props.image}/>    
                    
                        <Link href={{ pathname: 'http://localhost:8080/add', query: { name: 'Zeit' } }}>
                            <a><Button>fa fa-fw fa-heart</Button></a>
                        </Link>
                   
               

                <style jsx>
                {`
                    h6{
                        color: blue;
                    }
                    img {
                        max-width: 100%;
                        height: auto;
                    }
                    a{
                        position: absolute;
                        top: 70px;
                        bottom: 70px;
                        left:70px;
                        right: 70px;
                        
                    }
                
                `}    
                </style>
                <hr/>
        </div>
);



export default post;
